import { Language } from "@material-ui/icons";
import React from "react";
import Typical from "react-typical";
import "./profile.css"

function Profile() {
  return (
    <div
      className="profile-container"
    //   style={{
    //     backgroundImage: `url("assets/images/d")`,
    //     backgroundRepeat: "no-repeat",
    //     width: "100%",
    //     height: "600px",
    //     backgroundSize: "cover",
    //   }}

    >
      <div className="profile-parent row mt-5">
        <div className="col mt-5">
            <div className="profile-details">
            <div className="colz">
                <div className="colz-icon">
                <a href="/">
                    <i className="fa fa-facebook-square m-2 p-2"></i>
                </a>
                <a href="/">
                    <i className="fa fa-google-plus-square m-2"></i>
                </a>
                <a href="/">
                    <i className="fa fa-instagram m-2"></i>
                </a>
                <a href="/">
                    <i className="fa fa-youtube-square m-2"></i>
                </a>
                <a href="/">
                    <i className="fa fa-twitter m-2"></i>
                </a>
                </div>
            </div>
            <div className="profile-details-name">
                <apan className="primari-text"> HEY THERE !  I'M</apan>
            </div>
            <div className="profile-details-role">
                <span className="primary-text">
                {" "}
                <h2 className="profile-text">
                    {" "}
                    <Typical
                    loop={Infinity}
                    steps={[
                        "Mohd Nafees",
                        2000,
                        "Full Stack Developer",
                        2000,
                        // "Python Developer",
                        // 1000,
                        // "Django Developer",
                        // 1000,
                        // "Django Rest Framework Developer",
                        // 1000,
                        // "React.js Developer",
                        // 1000,
                    ]}
                    />
                </h2>
                <span className="profile-role-tagline">
                    Knack of builging web applications with front and back end
                    operations.
                </span>
                </span>
            </div>
            <div className="profile-options">
                <button className="btn primary-btn">
                {""}
                Hire Me{" "}
                </button>
                <a href="Nafees resume.pdf" download="mohd_nafees_cv.pdf">
                <button className="btn highlighted-btn"> Get Resume</button>
                </a>
            </div>
            <div className="profile-picture">
                <div className="profile-picture-background"></div>
            </div>
            </div>
        </div>

        <div className="col" >
            <div className="profile-image">
                <div className="inner-profile-box">
                    <div className=""
                        //   style={{
                        //     backgroundImage: `url("assets/images/images.jpg 14")`,
                        //     backgroundRepeat: "no-repeat",
                        //     width: "90%",
                        //     // height: "600px",
                        //     backgroundSize: "cover",
                        //   }}
                    >
                    <img src="assets/images/images.jpg 14" alt="" className="rounded-circle z-depth-2 sideimage"/>  
                    </div>
                </div>
            </div>
        </div>

      </div>
    </div>
  );
}

export default Profile;
